import React from "react";
import { useNavigate } from "react-router-dom";

function Detail() {
  const Navigate = useNavigate();

  return (
    <>
      <div className="content">
        <button onClick={Navigate("/")}>Accueil</button>;
      </div>
    </>
  );
}
export default Detail;
